`)])]),t("p",null,"그렇다면 단위는 무엇일까? 예를 들어 시간복잡도가 O(1)이라면 이것은 1초가 걸리다는 것을 의미하는 것일까? 여기서 1은 알고리즘이 Elementary Operation을 수행하는 횟수을 말한다. Elematary Operation이란 컴퓨터가 하나의 메모리 주소에 접근하는 것이라고 할 수 있다. 따라서 그 절대적인 시간은 컴퓨터마다 다를 수 있다. Big O Notaion에서 측정하는 알고리즘의 속도(시간복잡도)는 몇 초가 걸린다의 개념이 아니라, Elematary Operation을 몇 번 수행한다는 개념이다."),t("p",null,[m("그런데 하나의 메모리 주소에는 8비트만 저장할 수 있다. 만약 위의 알고리즘에서 숫자가 64비트의 숫자로 저장된 것이라면(자바스크립트에서는 기본적으로 64비트로 저장된다. 즉, 숫자 하나가 이미 8개의 메모리를 차지하고 있다.), "),t("code",null,"input[0]"),m("는 8개의 메모리 주소에 접근하므로 O(8)이 되어야 하지 않을까? 그렇지 않다.")]),t("h2",null,"Asymptotic Analysis"),t("p",null,"Big O Notation은 점근적 분석(Asymptotic Analysis)을 사용한다. 간단히 말하자면, 알고리즘의 입력값이 무한대에 가깝다고 가정한 상태에서 그 복잡도를 구하는 것이다. 위 알고리즘에서 만약 input의 길이가 10,000,000,000이라고 해도 길이가 5일 때와 똑같이 8개의 메모리 주소에 접근하는 일정한 Elematary Operation을 수행한다."),t("p",null,"Big O Notaion의 관심사는 알고리즘의 입력값 크기가 무한히 커질 때, 그 알고리즘의 복잡도가 어떻게 변하는지에 있다. 입력값 크기에 상관없이 일정한 복잡도라면, 그것이 8개의 메모리 주소에 접근하든 1개의 메모리 주소에 접근하든 1로 본다. 그래서 O(8)이나 O(10,000) 등은 존재하지 않고, 입력값의 크기에 영향을 받지 않는다면 모두 O(1)로 표시한다."),t("pre",{class:"language-js"},[t("code",{class:"language-js"},[t("span",{class:"token keyword"},"const"),m(" input "),t("span",{class:"token operator"},"="),m(),t("span",{class:"token punctuation"},"["),t("span",{class:"token number"},"1"),t("span",{class:"token punctuation"},","),m(),t("span",{class:"token number"},"2"),t("span",{class:"token punctuation"},","),m(),t("span",{class:"token number"},"3"),t("span",{class:"token punctuation"},","),m(),t("span",{class:"token number"},"4"),t("span",{class:"token punctuation"},","),m(),t("span",{class:"token number"},"5"),t("span",{class:"token punctuation"},"]"),t("span",{class:"token punctuation"},";"),m(`

